import React from 'react';
import TaskItem from './TaskItem';

const TaskList = ({ tasks, viewMode }) => {
  return (
    <div className={`task-list ${viewMode}`}>
      {tasks.length > 0 ? (
        tasks.map((task) => (
          <TaskItem key={task._id} task={task} />
        ))
      ) : (
        <p>No tasks found.</p>
      )}
    </div>
  );
};

export default TaskList;
